    var twoSum = function (nums, target) {
      if (nums.length < 2) return
      if (nums.length === 2) return [0, 1]
      if (nums.length > 2) {
        let i = 0, map = {}
        while (i < nums.length) {
          if (map[target - nums[i]] !== undefined) {
            return [map[target - nums[i]], i]
          } else {
            map[nums[i]] = i
          }
          i++
        }
      }
    };
    // console.log(twoSum([2, 5, 5, 11], 13));

        }
        console.log(map);
        arr.push(Math.max(...[...map.values()]))
        i++
      }
      return arr
